import React, { Component } from "react";

class BraingTrust extends Component {
  render() {
    return (
        <div align="center">
            The backbone of The Tembo Group is our Brain Trust: a deep bench of extraordinary, world - changing professionals.<br/>
            For every client engagement, we build bespoke, interdisciplinary teams, and provide the oversight and management needed for flawless execution.
            <br/><br/>
            Our teams are lean and cost effective, and eliminate the need for clients to engage multiple firms across a range of the best functions. We bring together the best minds and managers who can challenge old assumptions, point to new solutions, and handle every requirement with precision and care.
            <br/><br/>
            The Trust is a network of systems thinkers, movement-makers, and management consultants.<br/>
            Who are design-thinkers, doers, artist and culture-shifters. We are lawyers, futuriste, fundraisers, and researchers.<br/>
            We have been operating in the eye of the storm for many years, have seen the best brains tackle seemingly intractble problems, and know who and what it takes to get the job done.
            <br/><br/>
            KEY DIRECTORS AND EXPERTS
        </div>
    );
  }
}

export default BraingTrust;
